function addDataTicket(json) {
    var mainData = JSON.parse(json);
    var logo = mainData.OrganisationLogo;
    var orgName = mainData.OrganisationName;
    var customer = mainData.FirstName + " " + mainData.LastName;
    var list = mainData.Services;
    var date = mainData.txtRequestDate;
    // var qr = mainData.QRCode;
    var barcode = mainData.Barcode;
    var isvip = mainData.Vip;
    var vipprefix = $("#vipprefix").val();

    $("#ticketPrintPage .ticketLogo").append(`
    <img src="data:image/png;base64,` + logo + `">
  `);
    $("#ticketPrintPage .orgName p").text(orgName);
    $("#ticketPrintPage .mainName p").text(customer);
    $("#ticketPrintPage .dateArea strong").text(date);

    list.forEach(element => {
        var ticketnumber;
        if (isvip)
            ticketnumber = element.TicketNumber + vipprefix;
        else
            ticketnumber = element.TicketNumber;
        var newLi = `
        <li>
          <div class="tNo">
            <h2>`+ element.SectorName + `-` + ticketnumber  + `</h2>
          </div>
          <div class="tStage">
          MÉ™rtÉ™bÉ™: `+ element.Floor + `
          </div>
          <div class="tQueue">
            NÃ¶vbÉ™dÉ™ gÃ¶zlÉ™yÉ™nlÉ™r: <span>`+ element.WaitingCount + `</span>
          </div>
        </li>
    `;
        $("#ticketPrintPage .ticketMainContent ul").append(newLi);
    });
    // var qrcode = new QRCode("qrcode", {
    //   width: 128,
    //   height: 128
    // });
    // qrcode.makeCode(qr);

    //JsBarcode("#ticketBarcode", barcode, { height: 50 });
    JsBarcode("#ticketBarcode", barcode, { height: 30, width: 0.8, fontSize: 15 });

    $("#ticketPrintPage").css("display", "block");
    setTimeout(() => {
        PrintDiv();
        //  window.print({ silent: true });
    }, 1000);
}
